// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "contracts/Token.sol";
import "contracts/util/SafeMath.sol";

contract Duplicate  {
    using SafeMath for uint256;
    Token private token;

    address manager;

    uint256 rate;
    uint256 weiRaised;
    address payable wallet;
    uint256 tokenSold = 0;
    uint256 tokenAvailable;

    event TokenPurchase(
        address indexed _buyer,
        uint256 indexed _amount,
        uint256 indexed _tokens,
        uint256 timeStamp
    );

    constructor(uint256 _rate, address payable _wallet, Token _token, address _manager)   {
        require(rate !=0, "Rate has to be non-zero");
        require(_wallet != address(0), "Both can not be same addresses");

        rate = _rate;
        wallet = _wallet;
        token = _token;
        manager =_manager;
    }

    //Public view functions - rate, wallet, token, 

    // function availableTokens(uint256 _amount) external {
    //     require(msg.sender == manager, "You do not have necessary permissions");
    //     token.mint(manager, _amount);
    // }
    function buyTokens(address _recipientAddress,uint256 _amount) public payable {
        address buyer = msg.sender;
        uint256 _value = _amount.div(rate);

        _prePurchaseCheck(buyer, _amount);
        // uint256 _value = _amount.div(rate);
        // uint256 _value = _amount.mul(10**18).div(rate);

        _processPurchase(_recipientAddress, _value);
        tokenSold = tokenSold.add(_value);
        // tokenAvailable = 6000.sub(tokenSold);
        emit TokenPurchase(buyer, _amount, _value, block.timestamp);

    }

    function _prePurchaseCheck(address buyer, uint256 _amount) internal view {
        require(tokenSold <= 6000, "Sold out");
        require(_amount >= 0.5 ether && _amount<= 10 ether, "You can only purchase with amounts between 0.5 ether to 10 ether. Alternatively, the tokens available for sale maybe less than 0.5 ether. Write to dev@open.so with this screenshot.");
        require(buyer != address(0) || buyer != manager, "Buyer can not be zero address");
        this;
    }
    function _processPurchase(address _recipient, uint256 _value) internal {
        token.transfer(_recipient, _value);
        this;
    }

}
